import React, {Component, Fragment} from 'react';
import './App.css';

class App extends Component {
  foo = ()=>{return 'Bars'};

  render(){
    const name = "Mahitha";
    const loading = true;

    return (

      <div className="App">
        {loading ? <h4>Loading...</h4>:
        <h1>Hello world, {name}</h1>
        }

      </div>
    );
  }
}

export default App;
